import $googleIcon from 'common/assets/images/icon-google.png';
import './social-buttons.css';

const GoogleButton = (props) => {
  return (
    <div className="social-google-button" {...props}>
      <img src={$googleIcon} alt="Google's icon" />
      <p>Sign in with Google</p>
    </div>
  );
};

export {
  GoogleButton
}
